import "./App.css";

export default function TableauChart() {
  return (
    <div>
      <h2>Tableau Chart Embedded</h2>
      <div className="microsoft-forms">
        <iframe
          title="Tableau Chart"
          src="https://public.tableau.com/views/FavoritePerson/Sheet1?:language=en-US&publish=yes&:display_count=n&:origin=viz_share_link"
          width="100%"
          height="100%"
          style={{ border: "none", maxWidth: "100%", maxHeight: "100vh" }}
          allowFullScreen
          webkitAllowFullScreen
          mozAllowFullScreen
          msAllowFullScreen
        >
          Loading...
        </iframe>
      </div>
    </div>
  );
}
